public class Solution {
    private const int Mod = 1000000007;

    public int Count(string num1, string num2, int min_sum, int max_sum) {
        return (CountUpTo(num2, max_sum) - CountUpTo(num1, min_sum - 1) + Mod) % Mod;
    }

    private int CountUpTo(string num, int maxSum) {
        int[,] dp = new int[num.Length + 1, maxSum + 1];
        dp[0,0] = 1;

        for (int i = 0; i < num.Length; i++) {
            for (int j = 0; j <= maxSum; j++) {
                for (int d = 0; d < 10; d++) {
                    if (j + d <= maxSum) {
                        dp[i + 1, j + d] += dp[i, j];
                        dp[i + 1, j + d] %= Mod;
                    }
                }
            }
        }

        int sum = 0;
        for (int i = 1; i <= num.Length; i++) {
            for (int j = 0; j < num[i - 1] - '0'; j++) {
                if (i == 1 || num[i - 2] != '0' || j > 0) {
                    for (int k = 0; k <= maxSum; k++) {
                        sum = (sum + dp[i - 1, k]) % Mod;
                    }
                }
            }

            int currentSum = 0;
            for (int j = 0; j < i - 1; j++) {
                currentSum += num[j] - '0';
            }

            for (int j = currentSum; j + (num[i - 1] - '0') <= maxSum; j++) {
                sum = (sum + dp[i, j]) % Mod;
            }
        }

        return sum;
    }
}
